import React from "react";
import { NavLink } from "react-router-dom";

const Navbar = () => {
  return (
    <>
      <nav className="main-nav">
        <div className="logo">
          <h2>
            <span>N</span>FT
            <span> M</span>ARKETPLACE
          </h2>

          <ul>
            <li>
              <NavLink to="/explore" activeClassName="navbar__link--active">
                {" "}
                Explore{" "}
              </NavLink>
            </li>

            <li>
              <NavLink to="/popular" activeClassName="navbar__link--active">
                {" "}
                Popular{" "}
              </NavLink>
            </li>

            <li>
              <NavLink to="/sale" activeClassName="navbar__link--active">
                {" "}
                Sale{" "}
              </NavLink>
            </li>

            <li>
              <NavLink to="/collection" activeClassName="navbar__link--active">
                {" "}
                My Collection{" "}
              </NavLink>
            </li>

            <li>
              <NavLink to="/creators" activeClassName="navbar__link--active">
                {" "}
                Creators{" "}
              </NavLink>
            </li>
            <NavLink to="/create">
              <button>Create</button>
            </NavLink>
          <button>200 Tokens</button>
          </ul>

        </div>
      </nav>
    </>
  );
};

export default Navbar;
